INSERT INTO ricette VALUES  ('1', 'data:image/png;base64,', 'Spaghetti alla carbonara', 'tagliate il guanciale a cubetti o a listarelle dopo aver eliminato la cotenna, saltare il guanciale con olio, spegnere una volta che &egrave croccante.
Dopo di che quando la pasta &egrave pronta amalgamare il tuorlo dell uovo, il pecorino,  far s&igrave che diventi una crema cremosa, ed infine aggiungere il guanciale. Per concludere il piatto, formaggio e macinata di pepe!');
INSERT INTO ricette VALUES  ('2', 'data:image/png;base64,', 'Polpo con patate', '
Cuocere il polpo con l alloro per 50 minuti.
Cuocere le patate, dopo di che aggiungere olio, succo di limone, sale e pepe. Mescolare polpo e patate, a questo punto l insalata tiepida di polpo &egrave pronta!');
INSERT INTO ricette VALUES  ('3', 'data:image/png;base64,' ,'Spaghetti aglio , olio e peperoncino', 'scegliete un grosso spicchio di aglio e schiacciatelo delicatamente con la lama del coltello messa di piatto. Con questa piccola operazione sar&agrave pi&ugrave facile staccare la buccia. Sbucciate lo spicchio e tritatelo. Aprite a met&agrave un peperoncino fresco, eliminate i semi e tritatelo.
Unite a freddo in una grande padella g 50 di olio extravergine di oliva, l aglio, il peperoncino ed eventualmente il pepe.
Scolate gli spaghetti al dente, saltateli nella padella con il condimento e serviteli.');
INSERT INTO ricette VALUES  ('4', 'data:image/png;base64,' ,'Patatine Ondulate', 'Per prima cosa laviamo e peliamo le patate. Tagliamo le patate con l aiuto di un tagliaverdure ondulato, prima le tagliamo a fette e poi a stick. Versiamole in una ciotola con abbondante acqua fredda e due manciate di sale. Lasciamole riposare per 30 minuti. Trascorso il tempo di riposo, asciughiamo bene le nostre patatine su un canovaccio pulito e asciughiamole con carta da cucina. Scaldiamo l olio di semi di arachidi in una capiente pentola, per vedere se l olio &egrave a temperatura inseriamo uno stecchino di legno e se si creano tante bollicine intorno, l olio &egrave pronto. Immergiamo le patatine e facciamole dorare bene, scoliamole su della carta da cucina o carta paglia e saliamole a piacere.');


